static inline void node_Softmax( const float tensor_biased_tensor_name[1][20], float tensor_dropout_1[1][20] )
{
	/* Softmax 11 (caffe2-style)
	 * axis = -1
	 */
	float sum = 0.0;
	float max = -INFINITY;

	for( uint32_t i0=0; i0<1; i0++ ) {
	for( uint32_t i1=0; i1<20; i1++ ) {
		max = max>tensor_biased_tensor_name[i0][i1] ? max :tensor_biased_tensor_name[i0][i1];
	}
	for( uint32_t i1=0; i1<20; i1++ ) {
		tensor_dropout_1[i0][i1] = expf(tensor_biased_tensor_name[i0][i1]-max);
		sum += tensor_dropout_1[i0][i1];
	}
	for( uint32_t i1=0; i1<20; i1++ ) {
		tensor_dropout_1[i0][i1] /= sum;
	}
	sum = 0.0;
	max = -INFINITY;
	}
}


